import React from "react"
import { Flex, Text, Box, Image } from "rebass"
import Column from "../column"

const Title = props => (
	<Flex width="100%" justifyContent="space-around">
		{props.titles.map((title, key) => (
			<Column width={[title.width]} key={`${title.name}-${key}`}>
				{title.name}
			</Column>
		))}
	</Flex>
)
export const TableLine = props => (
	<Flex style={{ width: "100%" }}>
		{props.children}
		<Column>
			<Image src="/5/edit.png" />
		</Column>
		<Column>
			<Image src="/5/1.png" />
		</Column>
		<Column>
			<Image src="/5/2.png" />
		</Column>
		<Column>
			<Image src="/7/bigger.png" />
		</Column>
	</Flex>
)
export default props => {
	return (
		<Flex
			width={[1]}
			flexDirection="column"
			sx={{
				cursor: "pointer",
				background: "#FFF0E5"
			}}
		>
			<Title titles={props.titles} />
			<Box style={{ margin: "0 18px 18px 18px" }}>{props.children}</Box>
		</Flex>
	)
}
